import React, { Component } from "react";
import DisplayContent from "./DisplayContent";

class QnAPaginationAll extends Component {
  render() {
    return (
      <div>
        <div className="container-md">
          <h1>Interview Questions</h1>
          <DisplayContent />
        </div>
      </div>
    );
  }
}

export default QnAPaginationAll;
